        return 'Robot not found in the maze'
    for move in moves:
        for m in move:
            (dr, dc) = directions[m]
            (new_r, new_c) = (robot_pos[0] + dr, robot_pos[1] + dc)
            if 0 <= new_r < rows and 0 <= new_c < cols and (maze[new_r][new_c] != '#'):
                robot_pos = (new_r, new_c)
    return robot_pos

